{u'paging': {u'cursors': {u'after': u'WTI5dGJXVnVkRjlqZFhKemIzSTZORFl5TlRVeE5qZ3dORFUzTlRBMU9qRXpPRFUzTXpNPQ==', u'before': u'WTI5dGJXVnVkRjlqZFhKemIzSTZORFl3TVRFeU1qQTBNRE0wTnpnMk9qRXpOelV6T1RNPQ=='}}, u'data': [{u'message': u'Yo regale cultura cuando decidi cambiar los t√≠picos chocolates y peluches por libros, sobre todo de autores latinos como lemebel y Coelho :D', u'from': {u'name': u'Francisco Campos Villatoro', u'id': u'10204253075156809'}, u'id': u'460099290702744_1375393'}, {u'message': u'es discutible si regalar a Coelho es fomentar la cultura, pero en fin', u'from': {u'name': u'Cristian Ote\xedza Donoso', u'id': u'10153262143062459'}, u'id': u'460099290702744_1375428'}, {u'message': u'La mejor forma de regalar cultura es con un libro o un CD, vinilo, cassete o cualquier formato de buena m√∫sica :D', u'from': {u'name': u'Jos\xe9 Miguel Castro Pulgar', u'id': u'10205772788700497'}, u'id': u'460099290702744_1375753'}, {u'message': u'Hola Jos√© Miguel Castro Pulgar gracias por tu comentario! Recuerda compartir la imagen y estar√°s participando de nuestro concurso!!', u'from': {u'category': u'Non-Profit Organization', u'name': u'Fundaci\xf3n Ita\xfa Chile', u'category_list': [{u'id': u'151676848220295', u'name': u'Education'}, {u'id': u'133436743388217', u'name': u'Arts & Entertainment'}], u'id': u'244331422279533'}, u'id': u'460099290702744_1376254'}, {u'message': u'la mejor forma de regalar cultura en navidad es dar un libro de arte, cierto Carolina Paz Mart√≠nez Vargas', u'from': {u'name': u'Luis Alberto C\xe1rdenas Camus', u'id': u'10205885693404075'}, u'id': u'460099290702744_1382465'}, {u'message': u'Luis Arapato C√°rdenas Camus tienes TODA la raz√≥n! :D', u'from': {u'name': u'Carolina Paz Mart\xednez Vargas', u'id': u'10205727867706041'}, u'id': u'460099290702744_1382468'}, {u'message': u'Gracias a todos los que han participado! Recuerden que sortearemos los kits entre nuestros seguidores de Facebook! :)', u'from': {u'category': u'Non-Profit Organization', u'name': u'Fundaci\xf3n Ita\xfa Chile', u'category_list': [{u'id': u'151676848220295', u'name': u'Education'}, {u'id': u'133436743388217', u'name': u'Arts & Entertainment'}], u'id': u'244331422279533'}, u'id': u'460099290702744_1382471'}, {u'message': u'libros es siempre la primera opci√≥n, pero en Chill√°n es terrible, el √∫nico punto de venta de libros nuevos es el Jumbo, as√≠ que estamos sujetos al surtido y stock de un supermercado para leer', u'from': {u'name': u'Cathy Navarrete', u'id': u'10203105016338053'}, u'id': u'460099290702744_1382483'}, {u'message': u'Mi forma de regalar cultura es a trav√©s de la pintura, la cual describe sentimientos y emociones a trav√©s de los colores y sus formas. Creo que es una de las mejores maneras de expresar la cultura, plasmando en un cuadro, pared o donde se pueda, lo que hay en el fondo del alma. Suerte a todos!', u'from': {u'name': u'Ignacio L\xf3pez Sep\xfalveda', u'id': u'10153004524275116'}, u'id': u'460099290702744_1382485'}, {u'message': u'Regalar cultura siempre lo he encontrado dificil, no toda gente lo aprecia. apreciar la cultura hay que ense√±arlo desde chiquito! a mi sobrina siempre le he regalado libros, y desde hace unos a√±os, le regalo pinturas, blocks, pinceles, etc, para que le agarre el gustito a crear arte, y regalar cultura con lo que ella realize.', u'from': {u'name': u'Camila Constanza Jofr\xe9 Fuentes', u'id': u'10155082920590724'}, u'id': u'460099290702744_1383271'}, {u'message': u'regalar cultura yo creo que es mas que regalar m√∫sica o un libro.... tiene que ver como nos comportamos con el resto y nuestro entorno , habitos , valores , etc', u'from': {u'name': u'Alf Fuenzalida Fuentes', u'id': u'10204204593049693'}, u'id': u'460099290702744_1383781'}, {u'message': u'regalar cultura es regalar literatura, la m√∫sica es demasiado emocional para acertar, pero un buen libro siempre es un aporte', u'from': {u'name': u'Marianela Donoso Pinochet', u'id': u'1008113812541569'}, u'id': u'460099290702744_1383801'}, {u'message': u'Regalo cultura entregando el arte que es fruto de mis estudios; tocando piano para aquellos que gusten de o√≠rme. Con ello espero acercarlos a una vida m√°s humana.', u'from': {u'name': u'Maximiano Sep\xfalveda', u'id': u'10206777115886740'}, u'id': u'460099290702744_1383827'}, {u'message': u'literatura chilena, hay tanto, tan diverso y de tanta calidad', u'from': {u'name': u'Cristian Ote\xedza Donoso', u'id': u'10153262143062459'}, u'id': u'460099290702744_1383886'}, {u'message': u'para compartir cultura s√≥lo debemos permitirnos cautivarnos por el placer del arte y de las cosas simples de la vida, viajar, conversar, disfrutar un nuevo alimento, leer algo nuevo, ver de una manera distinta, la cultura est√° en todas partes s√≥lo falta que nos animemos a recibirla :)', u'from': {u'name': u'Leslita Mar\xeda', u'id': u'10206112363185181'}, u'id': u'460099290702744_1384019'}, {u'message': u'apagar el televisor y salir a recorrer stgo, hay muchas esquinas que ofrecen cultura, museos, teatro callejero, pinturas en murales, bibliotecas....', u'from': {u'name': u'Jorge Delpiano', u'id': u'482893181856872'}, u'id': u'460099290702744_1384474'}, {u'message': u'Idealmente algo hecho personalmente, pero si no alcanza l tiempo algo reciclado. Una compilaci√≥n de buena m√∫sica, un dibujo, poemas, un libro. Alg√∫n simbolismo chileno y pasar navidad con la tele apagada, cantando con una guitarra, compartiendo comida preparada por cada uno de mis amigos extranjeros que se van en Navidad junto conmigo a casa de mi padres en el campo y pasamos una navidad diferente, donde los villancicos se cambian por tonadas, y justamente m√∫sica latina que quisiera mostrarles.', u'from': {u'name': u'Karla Palta Marina', u'id': u'10204697666978286'}, u'id': u'460099290702744_1385430'}, {u'message': u'La m√∫sica es reflejo de nuestra identidad, y aunque hemos dejado que la globalizaci√≥n influya directamente en ella, latinoam√©rica es grande. Gracias por aportar a que nos regalemos m√∫sica y retornemos a nuestra identidad.', u'from': {u'name': u'Yilian Duque', u'id': u'10208005958005634'}, u'id': u'460099290702744_1385433'}, {u'message': u'Me acostumbr√© a regalar libros y discos. Son un excelente regalo!', u'from': {u'name': u'Carolina Cares', u'id': u'10152931645063957'}, u'id': u'460099290702744_1385473'}, {u'message': u'Cambiando el t√≠pico paquete de regalo por una experiencia que incluya un recorrido diferente por alg√∫n lugar emblem√°tico (en bicicleta, con Cultura Mapocho,...) y que incluya la visita a alg√∫n centro cultural (una exposici√≥n, concierto, obra de teatro, pel√≠cula) y una rica comida...', u'from': {u'name': u'Ang\xe9lica Navarro', u'id': u'10153212868415977'}, u'id': u'460099290702744_1385496'}, {u'message': u'REPARTIENDO CULTURA Y SOBRE TODO EL REAL SIGNIFICADO DE LA NAVIDAD EL AMOR, UNIDA Y COMPARTIR CON LA FAMILIA, AMIGOS Y LAS PERSONAS QUE UNO MAS AMA...

LA MUSICA NOS UNE SIN DISCRIMINACION, TODOS SOMOS IGUALES, GRANDES, CHICOS, VIEJOS Y JOVENES... LA MUSICA HACE LA UNIDAD Y CREA ESPERANZA

mi manera de regalar cultura es dando y ofreciendo ayuda a familia los que mas neceseitan no solo con algo material tambien ofreciendo una cena navide√±a en esas fechas, que es lo que mas necesitan.....', u'from': {u'name': u'Nicole Guti\xe9rrez', u'id': u'10153506056136609'}, u'id': u'460099290702744_1385733'}], u'summary': {u'total_count': 23, u'order': u'chronological'}}

